           <ol className='Data-list'>
               {profiles.map((profile)=>(
                   <li key={profile.id}>
                       {users[profile.userID].name}'s favorite movie is{''}
                        {movies[profile.movieID].name}
                   </li>
               ))}
           </ol>
        )
    }
}
